import React from 'react';
import { useNavigate } from 'react-router-dom';
import './InfoMap.css';
import { animals } from '../GalleryPage/animals'; // Asegúrate de importar 'animals' correctamente

const InfoMap = () => {
    const navigate = useNavigate();

    const handleAnimalClick = (animalKey) => (event) => {
        event.preventDefault(); // Evita la navegación por defecto del anchor
        const animalInfo = animals[animalKey];
        if (animalInfo) {
            navigate('/accordion', { state: { animal: animalInfo } });
        } else {
            console.error('Animal info not found for:', animalKey);
        }
    };

    return (
        <div className="info-map">
            <h2>Animales Endémicos por Macrozona</h2>
            <ul>
                <h3>Norte</h3>
                <li><a href="#norte" onClick={handleAnimalClick('Zorro Chilla')}>Zorro Chilla</a></li>
                <li><a href="#norte" onClick={handleAnimalClick('Chinchilla')}>Chinchilla</a></li>
                <li><a href="#norte" onClick={handleAnimalClick('Lagarto de Tarapacá')}>Lagarto de Tarapacá</a></li>
                <li><a href="#norte" onClick={handleAnimalClick('Gato Andino')}>Gato Andino</a></li>
                <li><a href="#norte" onClick={handleAnimalClick('Curiquinge')}>Curiquinge</a></li>
                <br />
                <h3>Centro</h3>
                <li><a href="#centro" onClick={handleAnimalClick('Leopardus colocola')}>Leopardus colocola</a></li>
                <li><a href="#centro" onClick={handleAnimalClick('Cisne de Cuello Negro')}>Cisne de Cuello Negro</a></li>
                <li><a href="#centro" onClick={handleAnimalClick('Puma')}>Puma</a></li>
                <li><a href="#centro" onClick={handleAnimalClick('Zorro Chileno')}>Zorro Chileno</a></li>
                <li><a href="#centro" onClick={handleAnimalClick('Colibrí de Pico Curiño')}>Colibrí de Pico Curiño</a></li>
                <br />
                <h3>Centro-Sur</h3>
                <li><a href="#centro-sur" onClick={handleAnimalClick('')}></a></li>
                <li><a href="#centro-sur" onClick={handleAnimalClick('Rana del Maule')}>Pudú</a></li>
                <li><a href="#centro-sur" onClick={handleAnimalClick('carpinteroNegro')}>Carpintero Negro</a></li>
                <li><a href="#centro-sur" onClick={handleAnimalClick('patoCortacorrientes')}>Pato Cortacorrientes</a></li>
                <li><a href="#centro-sur" onClick={handleAnimalClick('zorroCulpeo')}>Zorro Culpeo</a></li>
                <br />
                <h3>Sur</h3>
                <li><a href="#sur" onClick={handleAnimalClick('pinguinoMagallanes')}>Pingüino de Magallanes</a></li>
                <li><a href="#sur" onClick={handleAnimalClick('zorroColorado')}>Zorro Colorado</a></li>
                <li><a href="#sur" onClick={handleAnimalClick('condorAndino')}>Cóndor Andino</a></li>
                <li><a href="#sur" onClick={handleAnimalClick('cisneCuelloNegro')}>Cisne de Cuello Negro</a></li>
                <li><a href="#sur" onClick={handleAnimalClick('focaLeopardo')}>Foca Leopardo</a></li>
                <br />
                <h3>Austral</h3>
                <li><a href="#austral" onClick={handleAnimalClick('gatoMontes')}>Gato Montés</a></li>
                <li><a href="#austral" onClick={handleAnimalClick('nandu')}>Ñandú</a></li>
                <li><a href="#austral" onClick={handleAnimalClick('pinguinoRey')}>Pingüino Rey</a></li>
                <li><a href="#austral" onClick={handleAnimalClick('chungungoPatagonico')}>Chungungo Patagónico</a></li>
                <li><a href="#austral" onClick={handleAnimalClick('zorroFueguino')}>Zorro Fueguino</a></li>
            </ul>
        </div>
    );
};

export default InfoMap;
